c=0 #counter





# d being an arbitrary number of digits that is large enough to slow the computer a bit
# d will be use as the number for the cards
while [ $c -le 3] #creates 3 cards with values of a very huge number
do 
    echo $a # inputs the 1st answer to be option 1
    echo $d # gives the number to the server
    c=$(($c + 1)) #counter calculates the number of times it iterates
    echo $b # then does option 2
done # ends the first loop 
while [ $c -le 1000] #loop to force the timer to hit 20s
do
    echo $b # inputs the 2nd answer to be option 2
    c=$(($c + 1)) #counter calculates the number of times it iterates
